import "./AddExpense.css";
const AddExpense = () => {
  return (
    <div className="AddExpense-container">
      <input type="text" placeholder=" Enter Expense" />
      <br />
      <input
        type="number"
        placeholder=" Enter Expense Amount"
        required="true"
      />
      <br />
      <button type="submit">Submit</button>
    </div>
  );
};
export default AddExpense;
